const apiKey="n58b448gdktw01wij1fnfmiim2eszpy8low8",indexId="ltcrt5esea71";function parseSearchResults(e){return e.matches.map(t=>({content:t.content,title:e.objects[t.objectId].properties.properties._title.text,url:e.objects[t.objectId].properties.properties._url.text}))}async function searchContents(t){const e=await fetch("https://api.operand.ai/operand.v1.ObjectService/SearchWithin",{method:"POST",headers:{"Content-Type":"application/json",Authorization:`${apiKey}`,"Operand-Index-ID":`${indexId}`},body:JSON.stringify({query:t,limit:10})});if(e.ok)return parseSearchResults(await e.json());console.error(e)}function debounce(t,n=200){let e;return(...s)=>{clearTimeout(e),e=setTimeout(()=>{t.apply(this,s)},n)}}registerHandlers(debounce(t=>{let e=t.target.value;e!==""&&searchContents(e).then(t=>displayResults(e,t))}))